// RobotView.jsx (Full Updated View with Dashboard Features)
import React, { useEffect, useState } from 'react';
import { FiAlertTriangle, FiDownload, FiSettings } from 'react-icons/fi';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';
import API from '../utils/api';

const API_URL = API.defaults.baseURL.replace('/api', '');

export default function RobotView() {
  const [unknownFaces, setUnknownFaces] = useState([]);
  const [stats, setStats] = useState([]);
  const [lastUpdated, setLastUpdated] = useState('');
  const [alerts, setAlerts] = useState([]);
  const [fps, setFps] = useState(30);

  useEffect(() => {
    fetchUnknownFaces();
    fetchStats();
    fetchAlerts();
    const interval = setInterval(() => {
      fetchUnknownFaces();
      fetchStats();
      fetchAlerts();
      setLastUpdated(new Date().toLocaleTimeString());
    }, 10000);
    return () => clearInterval(interval);
  }, []);

  const fetchUnknownFaces = async () => {
    try {
      const res = await API.get('/unknown_faces');
      setUnknownFaces(res.data.slice(0, 6));
    } catch (e) { console.error('❌ Failed to fetch unknown faces'); }
  };

  const fetchStats = async () => {
    try {
      const res = await API.get('/stats/daily');
      setStats(res.data.reverse());
    } catch (e) { console.error('❌ Failed to fetch stats'); }
  };

  const fetchAlerts = async () => {
    try {
      const res = await API.get('/alerts');
      setAlerts(res.data);
    } catch (e) { console.error('❌ Failed to fetch alerts'); }
  };

  return (
    <div className="space-y-6 max-w-6xl mx-auto p-4 fade-in">
      <div className="flex justify-between items-center">
        <h1 className="text-2xl font-bold gradient-text">🧠 Robot Dashboard</h1>
        <a href="/admin" className="flex items-center gap-1 text-white bg-indigo-600 hover:bg-indigo-700 px-3 py-2 rounded-xl">
          <FiSettings /> Admin Panel
        </a>
      </div>

      {/* Snapshot Feed */}
      <div className="glass-card p-4">
        <h2 className="text-lg font-bold mb-2">📸 Unknown Detections</h2>
        <div className="grid grid-cols-3 gap-2">
          {unknownFaces.map((img, idx) => (
            <img
              key={idx}
              src={`${API_URL}/unknown_faces/${img.filename}`}
              alt="Unknown"
              className="rounded-xl border"
            />
          ))}
        </div>
      </div>

      {/* Stats Graph */}
      <div className="glass-card p-4">
        <h2 className="text-lg font-bold mb-2">📊 Daily Recognitions</h2>
        <ResponsiveContainer width="100%" height={200}>
          <BarChart data={stats}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="day" />
            <YAxis />
            <Tooltip />
            <Bar dataKey="total" fill="#6366f1" />
          </BarChart>
        </ResponsiveContainer>
      </div>

      {/* Alerts */}
      <div className="glass-card p-4">
        <h2 className="text-lg font-bold mb-2">🔔 Alerts</h2>
        {alerts.length === 0 ? (
          <p className="text-gray-500">No alerts</p>
        ) : (
          <ul className="space-y-1 text-red-600">
            {alerts.map((alert, idx) => (
              <li key={idx} className="flex items-center gap-2">
                <FiAlertTriangle /> {alert.message}
              </li>
            ))}
          </ul>
        )}
      </div>

      {/* Debug Console */}
      <div className="glass-card p-4 text-xs bg-black text-green-300 font-mono">
        <h2 className="font-bold mb-1">🐞 Debug Console</h2>
        <p>🎥 FPS: {fps}</p>
        <p>📦 DB Sync: ✅ OK</p>
        <p>🧠 Last Update: {lastUpdated}</p>
      </div>

      {/* Export Button */}
      <div className="flex justify-end">
        <a
          href={`${API_URL}/api/export_logs`}
          className="bg-green-600 text-white px-4 py-2 rounded-xl hover:bg-green-700 flex items-center gap-2"
          download
        >
          <FiDownload /> Export Chat Logs
        </a>
      </div>
    </div>
  );
}
